        public DataTable RecuperarListaTimbradosPorFecha(DateTime fechaIni, DateTime fechaFin)
        {
            SqlConnection conn = new SqlConnection("Data Source=172.24.20.11;Initial Catalog=Facturacion_QA;Persist Security Info=True;User ID=appFacturacion;Password=Aerobus001");
            DataTable dtResultado = new DataTable();
            SqlCommand cmm = new SqlCommand();
            cmm.CommandType = CommandType.Text;
            string consulta = "SELECT IdPeticionPAC FROM [dbo].[VBFac_XML_Pegaso] P WITH (NOLOCK) WHERE CAST(FECHAHORALOCAL AS DATE) >= '" + fechaIni.ToString("yyyy-MM-dd") + "' AND  CAST(FECHAHORALOCAL AS DATE) <= '" + fechaFin.ToString("yyyy-MM-dd") + "' AND Escorrecto = 1 ORDER BY IDPETICIONPAC";
            cmm.CommandText = consulta;
            cmm.CommandTimeout = Convert.ToInt32(System.Configuration.ConfigurationManager.AppSettings["SqlCommandTimeOut"]);
            cmm.Connection = conn;
            bool cerrarConexion = false;

            try
            {
                if (conn.State.Equals(ConnectionState.Closed))
                {
                    conn.Open();
                    cerrarConexion = true;
                }
                SqlDataAdapter da = new SqlDataAdapter(cmm);
                DataSet dsResult = new DataSet();
                da.Fill(dsResult, "dtResultado");
                dtResultado = dsResult.Tables["dtResultado"];

            }
            catch (SqlException ex)
            {
                throw ex;
            }
            catch (Exception ex)
            {
                throw ex;
            }
            finally
            {
                cmm.Dispose();
                if (cerrarConexion)
                {
                    conn.Close();
                }
            }
            return dtResultado;
        }

