        public bool ImpresoraDisponible(string PrinterName)
        {
            bool result = false;
            try
            {
                PrintDocument doc = new PrintDocument();
                doc.PrinterSettings.PrinterName = PrinterName;
                doc.PrintPage += new PrintPageEventHandler(PrintHandler);
                doc.Print();
                result = true;
            }
            catch (Exception)
            {
                result = false;
            }
            return result;

        }

        private void PrintHandler(object sender, PrintPageEventArgs ppeArgs)
        {
            Font FontNormal = new Font("Verdana", 12);
            Graphics g = ppeArgs.Graphics;
            g.DrawString("Your string to print", FontNormal, Brushes.Black, 0, 0, new StringFormat());
        }
